var tipuesearch = {"pages": [{'title': 'About', 'text': '\n \n \n 測試 \n 此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'w1-2', 'text': 'solidworks圖檔 :\xa0 solidworks圖檔 \n 體積對照表 \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w1-2.html'}, {'title': 'w3-4', 'text': '\n \n', 'tags': '', 'url': 'w3-4.html'}, {'title': 'w5-6', 'text': '什麼是API \n 指各種軟體組件之間一套明確定義的溝通方法。 簡單來說， 就像是讓你用的一個函式庫，呼叫你想要使用的函式，並給予相對應的參數，函式便回傳給你結果。 \n 在電腦程式設計裡, 它屬於應用程式介面(API)是人與機械-物品-軟體之間溝通的橋樑 \n ex:我想使用手機開啟facebook觀看影片 \n \xa0 \xa0 指令:讓手機開啟facebook執行我需要的事件 \n \n \n \n \n \n \n', 'tags': '', 'url': 'w5-6.html'}, {'title': 'w7-8', 'text': '工程師 \n 1.creat具有創造性 工程職業人員 需擁有條件 \xa0發明 設計 分析 構建\xa0 \xa0 且經過 \xa0 反覆測試 2.聰明精巧且正確的配置 數學英文很重要 (用於工程師之間溝通) mathematics數學分析能力 scientific principles 科學原理分析能力 \n', 'tags': '', 'url': 'w7-8.html'}, {'title': 'w9-10', 'text': '\n \n 下載 coppeliasim , 並以組為單位設計出一組機構, 可先在solidworks和inventor繪製完機構圖, 再放到coppeliasim進行模擬 \n \n \n', 'tags': '', 'url': 'w9-10.html'}, {'title': 'w11-12', 'text': '\n \n', 'tags': '', 'url': 'w11-12.html'}, {'title': 'w13-14', 'text': '\n \n', 'tags': '', 'url': 'w13-14.html'}, {'title': 'w15-17', 'text': '\n \n', 'tags': '', 'url': 'w15-17.html'}, {'title': 'w18', 'text': '\n 期末心得 \n 這門課這學期的課程內容有一大部分主要都是在繪圖，但我自己的繪圖能力並不是很厲害，所以有很多時候都是靠其他組員的協助，而期中之後需要每組設計並且繪製與模擬出一個機構，我覺得這是最難的一部份。第一次開小組會議時大家也都是沒什麼概念，但透過部不斷開會討論，最後也成功設計一個機構。感謝其他組員在我不會的項目上幫忙~', 'tags': '', 'url': 'w18.html'}]};